import React from 'react';
import Content from '../components/Content'
import workExamples from "../workExamples"


const Home = () => {
    return (
        <div>
            <header>
                <h1>
                    Home Page
                </h1>
            </header>
            <div>
            <dl className="dictionary">
            {workExamples.map((work) => (
                <Content
                    key={work.id}
                    gameTitle={work.title}
                    // name={work.name}
                    // description={work.meaning}
                />
                ))}
            </dl>
            </div>
        </div>
    )
}

export default Home;
